const featureToUpdate = parcel.getFeatureById("ATMI");
const images = [
  "https://media-crvox.sfo2.digitaloceanspaces.com/0xdd8c1db65964607c119535c98a6f6ed52b41588e/ATM%20Screen_271192baec396bfcd94ad0f8126fec2e.PNG",
  "https://media-crvox.sfo2.digitaloceanspaces.com/0xdd8c1db65964607c119535c98a6f6ed52b41588e/ATM Screen 2_0dc9c27508b37307b9405b2f97603e1b.PNG",
  "https://media-crvox.sfo2.digitaloceanspaces.com/0xdd8c1db65964607c119535c98a6f6ed52b41588e/ATM Screen 3_fb0d144851524089173208c32413420b.PNG",
  "https://media-crvox.sfo2.digitaloceanspaces.com/0xdd8c1db65964607c119535c98a6f6ed52b41588e/ATM Screen 4_a749b70098980417f2f8812430e87f0c.PNG"
  ];

let currentIndex = 0;
feature.on('click', e => {
  // 0, 1, 2, 3
  let nextImageIndex = currentIndex + 1;
  if ((nextImageIndex + 1) > images.length) {
    nextImageIndex = 0;
  }

  featureToUpdate.set({url: images[nextImageIndex]});

  currentIndex = nextImageIndex;
})

